sys_variable_value.value:
(function execute(inputs, outputs) {
    //search for templates containing the search string
    var templateList = [];
    var search = inputs.search_string.toString();
    new GlideQuery('sys_template')
        .where('template', 'CONTAINS', search)
        .select('name')
        .forEach(function (template) {
            // process each record
            templateList.push('Name: ' + template.name + ' sys_id: ' + template.sys_id);
        });

    outputs.template_list = templateList;
    outputs.template_count = parseInt(templateList.length);
    outputs.is_in_template = templateList.length > 0;

})(inputs, outputs);

